import React from "react";

const Skills = ({ skillsData }) => {
  return (
    <div className="bg-white text-purple-700 p-8 text-center">
      <h2 className="text-2xl">{skillsData.titles[0]}</h2>
      <div className="grid grid-cols-2 gap-4 w-1/2 mt-4">
        {skillsData.skills.map((skill) => (
          <div key={skill.id} className="flex items-center p-4 text-gray-500 text-lg">
            <img src={skill["img-link"]} alt={skill.alt} className="mr-2 w-10 h-10 rounded-full" />
            <span>{skill.alt}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Skills;
